INSERT INTO `announcement` VALUES (28,1,'도토리 지급 기준 안내입니다.','2024-08-14 14:26:44','2024-08-14 14:28:52','출석 보상\n- 매일 출석: 1밤송이\n- 연속 5일 출석: 3밤송이\n\n학습 보상\n- 매일 10문제 풀이: 1밤송이\n- 챗봇과 자유 대화: 1밤송이\n\n단, 보상은 각각 1일 1회로 제한됩니다.',77,5),(29,1,'단원별 학습 내용 안내입니다.','2024-08-14 14:28:00','2024-08-14 14:28:00','자모음(1단원) → 한 글자(2단원) → 받침 글자(3단원) → 음운 변동(4단원) → 단어(5단원) → 문장(6단원) → 헷갈리는 발음(7단원)\n\n자모음부터 헷갈리는 발음까지 체계적인 학습 커리큘럼을 제공합니다.',63,2),(30,1,'QnA 답변 안내입니다.','2024-08-14 16:21:27','2024-08-14 16:21:27','순차적으로 답변 중에 있습니다. 다소 시간이 소요될 수 있습니다.\n\n답변 시간: 10:00 ~ 18:00 (주말, 공휴일 제외)',60,6),(31,1,'왕밤빵 서비스 소개','2024-08-14 16:23:57','2024-08-14 16:52:50','왕밤빵은 청각장애인을 위한 발음 연습 플랫폼으로, \n단원별 학습부터 AI와의 자유 대화까지 다양한 방법으로 발음을 연습하고 의사소통 능력을 향상시키는 서비스를 제공합니다.',328,6),(32,1,'왕밤빵 기능 안내','2024-08-14 16:24:41','2024-08-14 16:47:39','- 단원별 학습: 체계적인 학습으로 발음하는 방법부터 음운론, 문장 연습까지 학습할 수 있습니다.\n- 자유 대화: AI와의 자유 대화를 통해 실생활에서의 발음 연습을 지원합니다.\n- 발음 분석: 사용자의 발음을 분석하고 피드백을 제공합니다.\n- 진도 관리: 메인페이지 내 캘린더를 통해 출석을 체크하고, 챕터 내 학습 현황을 통해 자신의 학습량을 체크할 수 있습니다.',139,6);
