DROP TABLE IF EXISTS `qna`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `qna` (
  `qna_id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'qna 식별 번호',
  `member_id` bigint NOT NULL,
  `title` varchar(100) NOT NULL,
  `content` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '질문 날짜',
  `is_answer` tinyint(1) NOT NULL DEFAULT '0' COMMENT '답변 여부',
  `answer` text,
  `answer_at` timestamp NULL DEFAULT NULL COMMENT '답변 날짜',
  `qna_category_id` tinyint NOT NULL COMMENT 'qna 유형 식별번호',
  PRIMARY KEY (`qna_id`),
  KEY `qna_member_idx` (`member_id`),
  KEY `qna_category_idx` (`qna_category_id`),
  CONSTRAINT `FKg55auu4qfkh4dqgxwjjbk5hdc` FOREIGN KEY (`qna_category_id`) REFERENCES `qna_category` (`qna_category_id`),
  CONSTRAINT `FKm1m3olxkohgmxid7vamkwo8i9` FOREIGN KEY (`member_id`) REFERENCES `member` (`member_id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
