INSERT INTO `qna` VALUES (1,4,'어떻게 하면 레벨이 오르나요?','어떻게 하면 다람쥐 레벨이 오르나요?','2024-08-11 01:28:27',1,'왕밤빵 이용해주셔서 감사합니다.\n다음 활동을 통해 보상을 모으신 후 일정 보상 갯수에 도달하면, 레벨이 오릅니다.\n출석 보상\n - 매일 출석: 1밤송이\n - 연속 5일 출석: 3밤송이\n 학습 보상\n - 매일 10문제 풀이: 1밤송이\\n\n - 챗봇과 자유 대화: 1밤송이\n단, 연속 출석를 제외한 보상은 각각 1일 1회로 제한됩니다.','2024-08-11 04:22:47',6),(2,2,'다람쥐 스탬프가 너무 귀여워요','스탬프는 어떻게 받나요?','2024-08-11 04:23:33',1,'왕밤빵 이용해주셔서 감사합니다.\n하루 최소 한번 새로운 학습을 하실 경우, 출석으로 인정되어 스탬프가 발급됩니다.','2024-08-15 04:20:32',6),(3,3,'랭킹은 언제 갱신되나요?','밤송이를 모았는데, 랭킹 갱신이 안 되요','2024-08-11 04:23:41',1,'왕밤빵을 이용해주셔서 감사합니다.\n 매일 자정 랭킹이 갱신됩니다.','2024-08-12 08:01:38',6),(4,5,'보상 관련해서 질문있습니다.','뭐하면 보상을 주나요?','2024-08-11 04:25:03',0,NULL,NULL,5),(5,9,'놓치다 발음이 녿치다에요?','노치다 아니에요?','2024-08-11 04:25:19',0,NULL,NULL,2),(6,13,'발음은 어떻게 인식되나요?','사람이 직접 듣고 적어주는 건가요?','2024-08-11 04:25:35',0,NULL,NULL,2),(7,26,'보상은 밤송이인가요? 도토리인가요?','.','2024-08-11 04:53:54',0,NULL,NULL,5),(8,14,'회원 탈퇴 후 재가입','같은 아이디로 가능해요?','2024-08-11 04:54:04',1,'왕밤빵을 이용해주셔서 감사합니다\n동일한 아이디로 재가입은 불가합니다.\n추가적인 문의가 있다면, 다시 문의바랍니다.\n감사합니다.','2024-08-12 08:37:07',1),(9,27,'발음 인식이 안됩니다.','인식 자체가 안 되는 거 같아요','2024-08-11 04:54:17',0,NULL,NULL,2),(10,29,'단어 업데이트는 언제 됩니까','ㅈㄱㄴ','2024-08-11 04:54:29',0,NULL,NULL,2),(11,30,'대화 연습이 초기화 되요','1시간 전에 대화하고 이어서 아려고 하는데 다시하래요','2024-08-11 04:55:19',0,NULL,NULL,4),(12,32,'아이디 변경 관련','아이디 변경 가능한가요','2024-08-11 10:49:33',1,'왕밤빵을 이용해주셔서 감사합니다.\n아이디 변경은 불가합니다.\n감사합니다.','2024-08-12 08:36:51',1),(13,33,'튜토리얼을 다시 보고 싶습니다.','문의드립니다.','2024-08-12 09:47:51',1,'왕밤빵을 이용해주셔서 감사합니다.\n메인페이지에서 우측 하단 ? 아이콘를 누르시면 다시 튜토리얼 확인이 가능합니다.','2024-08-12 13:54:02',6),(14,34,'대화연습은 24시간 되는 건가요?','언제든 할 수 있나요?','2024-08-12 13:56:42',0,NULL,NULL,4),(15,40,'어제 깜빡하고 공부를 못했는데..','끊어진 연속 일자 다시 살릴 수 없나요?','2024-08-12 13:57:07',1,'적극적으로 왕밤빵을 이용해주셔서 감사합니다.\n끊어진 연속 출석 날짜는 다시 학습 및 출석을 통해서만 살릴 수 있습니다.\n기존 출석 일자를 이을 수는 없습니다.','2024-08-12 14:00:18',1),(16,42,'오픈 채팅 내역','보고 싶어요','2024-08-12 14:28:57',1,'왕밤빵 이용해주셔서 감사합니다.\n개인정보 보호를 위해, 특별한 사유가 없는 한, 개인에게 오픈 채팅 내역을 공개하지 않고 있습니다.\n추가 문의가 있을 경우, 다시 문의 바랍니다.','2024-08-15 06:01:33',3),(17,43,'다람쥐 캐릭터으로 상품은 안 만드시나요','인형이라든가.. 만들 계획 없나요?','2024-08-12 14:29:02',1,'왕밤빵 마스코드 밤빵이를 사랑해주셔서 감사합니다.\n현재 상품 제작은 계획이 없습니다.','2024-08-13 05:43:44',6),(18,4,'카메라가 안되요','카메라부분이 검은 상자로 떠요','2024-08-12 14:29:09',1,'왕밤빵 이용해주셔서 감사합니다.\n브라우저 카메라 허용을 하지않으면 카메라를 사용할 수 없습니다.\n추가적인 문제가 있을 경우 다시 문의해주시길 바랍니다.','2024-08-14 21:40:31',2),(19,13,'관리자는 누구인가요','한명이에요??','2024-08-12 14:29:15',1,'왕밤빵 이용해주셔서 감사합니다.\n여러분의 원활한 이용을 위해 다수의 관리자가 운영하고 있습니다.\n불편 사항이 있을 경우 언제든 문의바랍니다.','2024-08-14 20:59:49',6),(20,26,'아 너무 재밌어요','진짜 너무 재밌네요','2024-08-12 14:29:21',1,'왕밤빵 이용해주셔서 감사합니다.\n여러분의 학습을 위해 언제나 노력하겠습니다.','2024-08-14 20:50:21',6),(21,5,'사용자간 커뮤니티 만들어주세요','사람과 대화하고 싶어요','2024-08-12 14:29:28',1,'왕밤빵을 이용해주셔서 감사합니다.\n현재 사용자간 커뮤니티를 위해 오픈채팅을 운영하고 있습니다.\n로그인 후 좌측 하단 말풍선 버튼으로 오픈채팅에을 이용할 수 있습니다.\n나아가 주신 의견을 바탕으로 더 만족스러운 서비스를 제공하기 위해 노력하겠습니다.','2024-08-15 07:36:51',6),(22,9,'질문이 있습니다','했던 공부 또 할 수 있나요?','2024-08-13 01:01:25',1,'왕밤빵을 이용해주셔서 감사합니다.\n이미 했던 공부를 언제나 원할 때 다시 공부하실 수 있습니다.\n우영우최애님의 학습을 응원합니다.','2024-08-15 07:37:44',2),(23,4,'대화 연습이 너무 좋네요','한 번 했는데, 또 할 수 있나요?','2024-08-13 01:10:41',1,'왕밤빵을 이용해 주셔서 감사합니다.\nAI 대화 연습은 2024.08.15기준 언제든 자유롭게 이용가능합니다.\n체리님의 학습을 응원합니다.','2024-08-15 07:40:49',4),(24,3,'단어하다가 그냥 문장 공부해도 되나요?','단어가 많아서 그냥 바로 문장하고 싶은데, 가능한지 궁금합니다.','2024-08-13 07:26:23',0,NULL,NULL,2),(25,26,'이메일 바꾸고 싶어요','근데.. 제 이메일이 아니라서.. 가능한가요?','2024-08-14 12:35:30',1,'왕밤빵을 이용해 주셔서 감사합니다.\n개인정보보호법상 본인의 이메일을 이용하여 회원 가입 및 정보 수정이 가능합니다.','2024-08-15 07:41:49',1),(26,2,'캐릭터 이전걸로 되돌아가고 싶은데,','가능한가요......?','2024-08-14 16:19:42',0,NULL,NULL,6),(27,13,'문의사항있습니다.','학습이 너무 유용한데, 모바일 지원 예정인가요?','2024-08-14 21:12:31',0,NULL,NULL,6),(28,1,'랭킹 시스템','랭킹 시스템은 어떻게 작동하나요?','2024-08-18 07:55:43',1,'랭킹 시스템은 하루에 한번 자정에 업데이트 됩니다.','2024-08-18 07:56:11',1);
