INSERT INTO `study_phonology` VALUES (447,'비음화','파열음 \'ㄱ, ㄷ, ㅂ\'이 비음 \'ㄴ, ㅁ\' 앞에서 각각 동일한 조음 위치의 비음이 ‘ㅇ,ㄴ,ㅁ’으로 발음되는 현상','국물 [궁물],받는다 [반는다],입는다 [임는다]'),(448,'유음화','비음 \'ㄴ\'이 앞이나 뒤에 오는 유음 \'ㄹ\'의 영향으로 \'ㄹ\'로 발음되는 현상','신라 [실라],칼날 [칼랄]'),(449,'구개음화','받침 \'ㄷ, ㅌ\'인 형태소가 모음 ‘ㅣ\'나 반모음 \'j\'로 시작되는 형식 형태소와 만나 구개음인 \'ㅈ, ㅊ\'으로 발음되는 현상\\‘ㄷ’ 뒤에 형식 형태소 ‘-히-’가 올 때 ‘ㄷ’과 ‘ㅎ’이 결합하여 이루어진 ‘ㅌ’이 ‘ㅊ’ 으로 발음되는 경우 존재','굳이 [구지],같이 [가치]\\닫히다 [다치다]'),(450,'경음화','앞 음절의 받침에 의해 뒷 소리 초성이 평음에서 경음(된소리)으로 발음되는 현상\\받침 ‘ㄱ, ㄷ, ㅂ’ 뒤의 경음화\\어간 받침 ‘ㄴ, ㅁ’ 뒤의 경음화\\한자어에서 ‘ㄹ’ 받침 뒤에 연결되는 ‘ㄷ, ㅅ, ㅈ’의 경음화\\관형사형 어미 ‘-(으)ㄹ’ 뒤의 경음화','국밥 [국빱],먹도록 [먹또록],믿지 [믿찌],춥고 [춥꼬]\\신고 [신꼬],껴안고 [껴안꼬],감다 [감따]\\발달 [발딸],질서 [질써],물질 [물찔],갈등 [갈뜽]\\할 것을 [할꺼슬]'),(451,'ㄴ\' 첨가','합성어 및 파생어에서 앞말이 자음으로 끝나고 뒷말이 모음’ㅣ’나 반모음 ‘j’로 시작할 때, ‘ㄴ’이 그 사이에 첨가되는 현상','맨입 [맨닙],솜이불 [솜니불],한여름 [한녀름]'),(452,'반모음 첨가','모음으로 끝난 형태소 뒤에 단모음으로 시작하는 형태소가 올 때 반모음 ‘j’가 첨가되는 현상','피어 [피어/피여],되어 [되어/되여]'),(453,'자음군 단순화','음절 끝에 두 개의 자음이 올 때, 이 중 한 자음이 탈락하는 현상','몫 [목],값 [갑],젊다 [점따],읊다 [읍따]'),(454,'자음탈락','ㄹ 탈락\\실질 형태소의 끝소리 ‘ㄹ’이 ‘ㄴ, ㅅ’ 등의앞에서 탈락하는 현상\\ㅎ 탈락\\어간 끝소리 ‘ㅎ’이 모음으로 시작하는 형태 형태소와 결합할 때 탈락하는 현상','알- + -니 ⇒ 아:니,알- + -시- + -고 ⇒ 아:시고\\넣어 [너어],쌓이다 [싸이다]'),(455,'모음탈락','ㅡ 탈락\\어간 끝소리 ‘ㅡ’가 ‘아/어’로 시작하는 어미 앞에서 탈락하는 현상\\동일 모음 탈락\\어간 말 모음과 어미 첫 모음이 동일할 때 한 모음이 탈락하는 현상','끄- + -어서 ⇒ 꺼서,담그- + -아도 ⇒ 담가도\\자- + -아서 ⇒ 자서,서- + -어 ⇒ 서'),(456,'두음법칙','한자음 ‘랴,려,례,료,류,리’와 ‘녀,뇨,뉴,니’가 단어의 첫머리에 올때는 ‘ㄹ’이나’ㄴ’이 탈락되어 각[야,여,예,요,유,이]와 [여,요,유,이]로 발음된다.','불량 [불양],량심 [양심],자녀 [자여],녀성 [여성]'),(457,'거센소리되기','‘ㅎ’과 예사소리인 ‘ㄱ, ㄷ, ㅂ, ㅈ’이 만나 각각 거센소리인 [ㅋ, ㅌ, ㅍ, ㅊ]으로 발음되는 현상','입학 [이팍],좋다 [조타],각하 [가카],넣지 [너치]');
/*!40000 ALTER TABLE `study_phonology` ENABLE KEYS */;
UNLOCK TABLES;

