DROP TABLE IF EXISTS `study_resource`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `study_resource` (
  `study_id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'AI, 학습 식별 번호',
  `pronounce_method` text NOT NULL,
  `mouth_img` varchar(255) NOT NULL COMMENT '입모양 이미지',
  `tongue_img` varchar(255) NOT NULL COMMENT '혀모양 이미지',
  `syllable_location` varchar(10) NOT NULL COMMENT '초성, 중성, 종성',
  PRIMARY KEY (`study_id`),
  CONSTRAINT `FKq2mxgoub518wtn6wxg8sdrk9n` FOREIGN KEY (`study_id`) REFERENCES `study` (`study_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2438 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

