INSERT INTO `study_resource` VALUES (1,'목젖으로 콧길을 막고 혀뿌리를 높여 여린입천장을 막았다가 뗄 때, 막았던 공기를 터뜨리며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요. 초성일 때는 안울림소리, 모음 사이에서는 울림소리예요','/images/study_resource/consonants/mouth/1.png','/images/study_resource/consonants/tongue/1.png','INITIAL'),(2,'목젖으로 콧길을 막고 혀뿌리로 여린입천장을 막았다가 세게 공기를 터뜨려 소리를 내요.','/images/study_resource/consonants/mouth/2.png','/images/study_resource/consonants/tongue/2.png','INITIAL'),(3,'혀끝을 윗잇몸에 붙였다가 떼면서 날숨을 콧구멍으로 나오게 해, 코안의 공명을 일으키며 소리를 내요. 목청이 떨리는 울림소리예요.','/images/study_resource/consonants/mouth/3.png','/images/study_resource/consonants/tongue/3.png','INITIAL'),(4,'목젖으로 콧길을 막고 혀끝을 윗잇몸에 대어 입길을 막았다가, 공기를 터뜨리면서 소리를 내요.','/images/study_resource/consonants/mouth/4.png','/images/study_resource/consonants/tongue/4.png','INITIAL'),(5,'목젖으로 콧길을 막고 혀끝을 윗잇몸에 대어 입길을 막았다가 세게 공기를 터뜨려 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/5.png','/images/study_resource/consonants/tongue/5.png','INITIAL'),(6,'모음 사이에서는 혀끝으로 윗잇몸을 한 번 가볍게 치면서 진동하는 소리예요.','/images/study_resource/consonants/mouth/6.png','/images/study_resource/consonants/tongue/6.png','INITIAL'),(7,'입을 다물고 날숨을 코안으로 내보내며 목청을 울려서 소리를 내요.','/images/study_resource/consonants/mouth/7.png','/images/study_resource/consonants/tongue/7.png','INITIAL'),(8,'목젖으로 콧길을 막고 두 입술을 다물었다가 벌려 입안의 공기를 밖으로 터뜨리며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/8.png','/images/study_resource/consonants/tongue/8.png','INITIAL'),(9,'목젖으로 콧길을 막고 두 입술을 다물었다가 벌려 입안의 공기를 밖으로 터뜨리며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/9.png','/images/study_resource/consonants/tongue/9.png','INITIAL'),(10,'혀끝을 윗잇몸이나 센입천장에 거의 붙이다시피 올려요. 날숨이 그 사이를 비집고 나오면서 마찰하도록 해 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/10.png','/images/study_resource/consonants/tongue/10.png','INITIAL'),(11,'혀끝을 윗잇몸이나 센입천장에 거의 붙이다시피 올려요. 날숨이 그 사이를 비집고 나오면서 마찰하도록 해 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/11.png','/images/study_resource/consonants/tongue/11.png','INITIAL'),(12,'종성일 때는 혀뿌리를 높여 여린입천장을 막고 날숨을 코안으로 내보내며 소리를 내요. 코가 막힌 듯한 소리인 비음이에요.','','/images/study_resource/consonants/tongue/12.png','FINAL'),(13,'혓바닥을 센입천장에 넓게 대었다가 공기를 터뜨리면서 마찰도 함께 일으키며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/13.png','/images/study_resource/consonants/tongue/13.png','INITIAL'),(14,'혓바닥을 센입천장에 넓게 대었다가 공기를 터뜨리면서 마찰도 함께 일으키며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/14.png','/images/study_resource/consonants/tongue/14.png','INITIAL'),(15,'혓바닥을 센입천장에 넓게 대었다가 터뜨릴 때, 날숨을 거세게 내뿜으며 마찰도 함께 일으키며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리이며, 거센소리에요.','/images/study_resource/consonants/mouth/15.png','/images/study_resource/consonants/tongue/15.png','INITIAL'),(16,'목젖으로 콧길을 막고 혀뿌리를 높여 여린입천장에 붙여 입길을 막았다가 뗄 때, 거세게 공기를 터뜨리며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/16.png','/images/study_resource/consonants/tongue/16.png','INITIAL'),(17,'목젖으로 콧길을 막고 혀끝을 윗잇몸에 대었다가 뗄 때, 거세게 공기를 터뜨리며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/17.png','/images/study_resource/consonants/tongue/17.png','INITIAL'),(18,'목젖으로 콧길을 막고 두 입술을 다물었다가 뗄 때, 거세게 공기를 터뜨리며 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/18.png','/images/study_resource/consonants/tongue/18.png','INITIAL'),(19,'목청을 좁혀 숨을 내쉴 때 공기가 그 가장자리를 마찰하도록 해 소리를 내요. 성대를 진동시키지 않고 내는 안울림소리예요.','/images/study_resource/consonants/mouth/19.png','/images/study_resource/consonants/tongue/19.png','INITIAL'),(20,'발음할 때 입술이나 혀가 고정되어 움직이지 않아요. 입이 크게 열려서 혀의 위치가 낮고 혀의 최고점이 뒤쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/20.png','/images/study_resource/vowels/tongue/20.png','MIDDLE'),(21,'발음할 때 입술이나 혀가 고정되어 움직이지 않아요. 입이 크게 열려서 혀의 위치가 낮고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/21.png','/images/study_resource/vowels/tongue/21.png','MIDDLE'),(22,'발음할 때 입술 모양이 바뀌거나 혀가 움직이며 내는 소리에요.[ㅣ+ㅏ]로 ㅣ를 약하고 짧게 발음해요.\\ㅣ = 입이 조금 열려서 혀의 위치가 높고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.\\ㅏ = 입이 크게 열려서 혀의 위치가 낮고 혀의 최고점이 뒤쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/22.png','/images/study_resource/vowels/tongue/22.png','MIDDLE'),(23,'[ㅣ+ㅐ]로 ㅣ를 약하고 짧게 발음해요.\\ㅣ = 입이 조금 열려서 혀의 위치가 높고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.\\ㅐ = 입이 크게 열려서 혀의 위치가 낮고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/23.png','/images/study_resource/vowels/tongue/23.png','MIDDLE'),(24,'발음할 때 입술이나 혀가 고정되어 움직이지 않아요. 입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 뒤쪽에 있어요.  입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/24.png','/images/study_resource/vowels/tongue/24.png','MIDDLE'),(25,'발음할 때 입술이나 혀가 고정되어 움직이지 않아요. 입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/25.png','/images/study_resource/vowels/tongue/25.png','MIDDLE'),(26,'[ㅣ+ㅓ]로 ㅣ를 약하고 짧게 발음해요.\\ㅣ = 입이 조금 열려서 혀의 위치가 높고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.\\ㅓ =  입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 뒤쪽에 있어요.  입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/26.png','/images/study_resource/vowels/tongue/26.png','MIDDLE'),(27,'[ㅣ+ㅔ]로 ㅣ를 약하고 짧게 발음해요.\\ㅣ = 입이 조금 열려서 혀의 위치가 높고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.\\ㅔ = 입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/27.png','/images/study_resource/vowels/tongue/27.png','MIDDLE'),(28,'발음할 때 입술이나 혀가 고정되어 움직이지 않아요.입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 뒤쪽에 있어요. 입술을 둥글게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/28.png','/images/study_resource/vowels/tongue/28.png','MIDDLE'),(29,'[ㅗ+ㅏ]로 ㅗ를 약하고 짧게 발음해요.\\ㅗ = 입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 뒤쪽에 있어요. 입술을 둥글게 하여 내는 소리에요.\\ㅏ = 입이 크게 열려서 혀의 위치가 낮고 혀의 최고점이 뒤쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.','/images/study_resource/vowels/mouth/29.gif','/images/study_resource/vowels/tongue/29.png','MIDDLE'),(30,'[ㅗ+ㅐ]로 ㅗ를 약하고 짧게 발음해요.\\ㅗ = 입이 더 열려서 혀의 위치가 중간이고 혀의 최고점이 뒤쪽에 있어요. 입술을 둥글게 하여 내는 소리에요.\\ㅐ = 입이 크게 열려서 혀의 위치가 낮고 혀의 최고점이 앞쪽에 있어요. 입술을 납작하게 하여 내는 소리에요.